import '../index.css';
function Medaillion() {
    return(
        <div className="container mx-auto">
            <div className="grid grid-cols-2 gap-4">
                <div className="bg-gray-700 rounded-lg p-4 my-5">
                    <h2 className="text-2xl font-bold text-white">Medallion</h2>
                    <p className="text-white p-4">
                        Zde bude extrémní text, který bude tak extrémní, že Vás to ujme a dáte mi Vaše peníze :).
                    </p>
                </div>
            </div>
        </div>
    )
}

export default Medaillion;
